import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";


const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <>
      {array.map((element) => {
        return <Button variant="text">{element}</Button>;
      })}


      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Container></Container>
          xs=8
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={4}>
          xs=4
        </Grid>
        <Grid item xs={8}>
          xs=8
        </Grid>
      </Grid>
   
    </>
  );
}

export default Home;
